function Navbar() {
    return (
      <nav>
        <h1>Perfumy</h1>
        <ul>
          <li>Home |</li>
          <li>Product |</li>
          <li>About Us |</li>
          <li>Contact Us |</li>
        </ul>
      </nav>
    );
  }

export default Navbar
